import { useParams } from 'react-router-dom'
import PageTitle from '../../../components/ui/page-title/PageTitle'
import PageSubtitle from '../../../components/ui/page-subtitle/PageSubtitle'
import { mapList } from '../../../dummy_data/map_data'

export default function Map() {
    const { name } = useParams()
    const capitalizedName = name.charAt(0).toUpperCase() + name.slice(1)
    const mapInfo = mapList.filter(map => map.name === capitalizedName)

    return (
        <div className="Map">
            <PageTitle title={capitalizedName} />
            <img alt={`${capitalizedName}`} src={`/images/maps/${capitalizedName}/${capitalizedName}-1F.webp`} />
            <map name="workmap">
                <area></area>
            </map>
        </div>
    )
}
